const axios = require('axios');

interface IGenero {
    id: number;
    name: string;
}

export interface IGeneros extends Array<IGenero> {}

export const getGeneros = (): IGeneros => {
    const generos: IGeneros = [{ id: 20, name: 'Ação' }];

    axios
        .get('http://localhost:3001/generos')
        .then((response: any) => {
            console.log(response);
        })
        .catch((error: any) => {
            console.log(error);
        });

    return generos;
};
